<section id="work">
	<div class="container text-center">
		<img class="covai_logo" src="img/covai.png">
		
	<div class="row digitalmargintop">
		<div class="col-sm-4">
			<h4>EVENTS</h4>
			<hr class="redline">
			<img class="workicon" src="img/events.png">
			<p class="contact_line">With heythere app, know what’s happening around Coimbatore. Plan your next outing with more of options just pooled in for you. Never again a boring week end. Explore more of coimbatore right at your home. Begin the fun. We work hard to find you the best options at your city.</p>
		</div>
		<div class="col-sm-4">
			<h4>OFFERS</h4>
			<hr class="redline">
			<img class="workicon" src="img/tag.png">
			<p class="contact_line">Delight yourself by knowing crazy offers around you and all over Coimbatore. Whether its apparels, outfits, food or any discounts you’re after, there’s a can’t-miss bargain for every single one of you.</p>
		</div>
		<div class="col-sm-4">
			<h4>COMMUNITY</h4>
			<hr class="redline">
			<img class="workicon" src="img/community.png">
			<p class="contact_line">Chat on the go, you could be looking for someone new for mid-night coffee, a workout partner or suggestions on your child’s new school, find solutions for all your needs right at your phone. From finding a home teacher to a general discussion on cricket. Talk to the city now. Pretty cool, aint it?</p>
		</div>
	</div>
	</div>
</section>
